private boolean hasnext() {
  if (resultSet == null)
    return false;
  try {
    if (resultSet.next()) {
      return true;
    } else {
      close();
      return false;
    }
  } catch (SQLException e) {
    logError("Error reading data ", e);
    close();
    return false;
  }
}

